import React from 'react';
import hh from './images/hydroo.jpg'

const Product=()=>{
    return(
        <div className="container">
            <img src={hh} alt="hh" />
            <div className='container-h'>
            <h1>A Square Hydroponics</h1>
            <p>Hydroponic System is a system of growing crops without soil, often called soilless farming. </p>
            </div>
            
            
        </div>


    )
}
        
        


export default Product;
